import React from 'react';
import { AppBar, Toolbar, Typography, Button, Container, Menu, MenuItem } from '@mui/material';
import { Link } from 'react-router-dom';

const Header = () => {
  const [anchorElServices, setAnchorElServices] = React.useState(null);
  const [anchorElCompany, setAnchorElCompany] = React.useState(null);

  const handleServicesClick = (event) => setAnchorElServices(event.currentTarget);
  const handleCompanyClick = (event) => setAnchorElCompany(event.currentTarget);
  const handleClose = () => {
    setAnchorElServices(null);
    setAnchorElCompany(null);
  };

  return (
    <AppBar position="static" sx={{ bgcolor: '#1976d2' }}>
      <Container>
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1, fontWeight: 700 }}>
            Hono Technology
          </Typography>
          <Button color="inherit" component={Link} to="/">Home</Button>
          <Button color="inherit" component={Link} to="/explore">Explore</Button>
          <Button color="inherit" component={Link} to="/about">About Us</Button>
          
          {/* Services Dropdown */}
          <Button color="inherit" onClick={handleServicesClick}>Services</Button>
          <Menu anchorEl={anchorElServices} open={Boolean(anchorElServices)} onClose={handleClose}>
            <MenuItem onClick={handleClose}>App Development</MenuItem>
            <MenuItem onClick={handleClose}>Data Engineering & Analysis</MenuItem>
            <MenuItem onClick={handleClose}>IT-Resources</MenuItem>
            <MenuItem onClick={handleClose}>Full Stack Development</MenuItem>
            <MenuItem onClick={handleClose}>Infrastructure Services</MenuItem>
            <MenuItem onClick={handleClose}>Application Management</MenuItem>
            <MenuItem onClick={handleClose}>IT Consulting Services</MenuItem>
            <MenuItem onClick={handleClose}>IT Security</MenuItem>
            <MenuItem onClick={handleClose}>Testing</MenuItem>
            <MenuItem onClick={handleClose}>Mobile Apps</MenuItem>
            <MenuItem onClick={handleClose}>Cloud Computing</MenuItem>
            <MenuItem onClick={handleClose}>Quality Assurance</MenuItem>
            <MenuItem onClick={handleClose}>Offshore Software Development</MenuItem>
            <MenuItem onClick={handleClose}>Web Development</MenuItem>
          </Menu>

          {/* Company Dropdown */}
          <Button color="inherit" onClick={handleCompanyClick}>Company</Button>
          <Menu anchorEl={anchorElCompany} open={Boolean(anchorElCompany)} onClose={handleClose}>
            <MenuItem onClick={handleClose} component={Link} to="/about">About Us</MenuItem>
            <MenuItem onClick={handleClose}>Our Goals</MenuItem>
            <MenuItem onClick={handleClose}>Our Team</MenuItem>
            <MenuItem onClick={handleClose}>Our Philosophy</MenuItem>
            <MenuItem onClick={handleClose}>Privacy Policy</MenuItem>
          </Menu>

          <Button color="inherit" component={Link} to="/careers">Careers</Button>
          <Button color="inherit" component={Link} to="/blog">Blog</Button>
          <Button color="inherit" component={Link} to="/contact">Contact Us</Button>
          <Button color="inherit" href="https://zvertexai.com" target="_blank">Zvertex AI</Button>
        </Toolbar>
      </Container>
    </AppBar>
  );
};

export default Header;
